import React from "react";

const SignInForm = () => {
  return (
    <div>
      <form action="">
        <label htmlFor="email">Email</label>
        <input type="email" required name="email" />

        <label htmlFor="password">Mot de Passe</label>
        <input type="password" required name="email" />
      </form>
    </div>
  );
};

export default SignInForm;
